import Main from './Main'
import User from './User'

class App extends React.Component {
  constructor () {
    super()
    this.state = {
      toggle: true
    }
  }

  handleChane () {
    this.setState({
      toggle: !this.state.toggle
    })
  }

  render () {
    return (
      <div>
      <Main />
      </div>
    )
  }
}

export default App
